import React from 'react';
import Hero from '../components/Hero';
import About from '../components/About';
import Blog from '../components/Blog';
import Service from '../components/Service';

function Home() {
    return (
        <div>
            <Hero />
            <About />
            <Blog />
            <Service />
        </div>
    );
}

export default Home;
